import{e}from"./app.3be01406.js";import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";const t={},a=e('<h2 id="required-reading" tabindex="-1"><a class="header-anchor" href="#required-reading" aria-hidden="true">#</a> Required Reading</h2><p>If you&#39;re on firmware version 14.5 or later, you can update to 14.8.1 and use the Odysseyra1n jailbreak instead if your device is compatible.</p><p>This is achieved by simply updating through the Settings application normally. Because the latest version for these devices is 14.8.1, we can easily update to the desired firmware version.</p><p>If you have installed update blocking via tvOS Beta profiles, you must first remove that profile before updating. If you don&#39;t know what this means, ignore this.</p><div class="custom-container danger"><p class="custom-container-title">DANGER</p><p>Odysseyra1n only fully supports A8(X), A9, A10(X), and A11 on iOS 14.8.1.</p></div><div class="custom-container warning"><p class="custom-container-title">WARNING</p><p>A11 devices do not allow you to use SEP functionality in a jailbroken state with Odysseyra1n on iOS 14.8.1. SEP functionality are things such as a passcode, Face ID/Touch ID, and Apple Pay.</p></div><h2 id="removing-profiles" tabindex="-1"><a class="header-anchor" href="#removing-profiles" aria-hidden="true">#</a> Removing Profiles</h2><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>Only follow this if you&#39;ve installed update blocking in the past.</p></div><ol><li>Open the Settings application</li><li>Tap <code>General</code> -&gt; <code>Profile</code><ul><li>This may also be called <code>Profile and Device Management</code></li></ul></li><li>Tap on the tvOS Beta Software Profile <ul><li>If this is not there, you can skip to the next section of the guide</li></ul></li><li>Tap <code>Remove Downloaded Profile</code></li></ol><h2 id="updating-to-14-8-1" tabindex="-1"><a class="header-anchor" href="#updating-to-14-8-1" aria-hidden="true">#</a> Updating to 14.8.1</h2><ol><li>Plug your device into power and connect to the Internet with Wi-Fi</li><li>Open the Settings application</li><li>Tap <code>General</code> -&gt; <code>Software Update</code><ul><li>Ensure that the version you are updating to is 14.8.1</li></ul></li><li>Download and install the update</li></ol>',11);function o(n,l){return a}var d=i(t,[["render",o]]);export{d as default};
